Систе́ма (др.-греч. σύστημα «целое, составленное из частей; соединение») — множество элементов, находящихся в отношениях и связях друг с другом, которое образует определённую целостность, единство. Целое больше суммы своих частей. Аристотель. Метафизика Потребность в использовании термина «система» возникает в тех случаях, когда нужно подчеркнуть, что что-то является большим, сложным, не полностью сразу понятным, при этом целым, единым. В отличие от понятий «множество», «совокупность» понятие системы подчёркивает упорядоченность, целостность, наличие закономерностей построения, функционирования и развития (см. ниже ). В повседневной практике слово «система» может употребляться в различных значениях, в частности: 
* теория, например, философская система Платона; 
* классификация, например, периодическая система химических элементов Д. И. Менделеева; 
* метод практической деятельности, например, система Станиславского; 
* способ организации мыслительной деятельности, например, система счисления; 
* совокупность объектов природы, например, Солнечная система; 
* некоторое свойство общества, например, политическая система, экономическая система и т. п.; 
* совокупность установившихся норм жизни и правил поведения, например, правовая система или система моральных ценностей; 
* закономерность («в его действиях прослеживается система»); 
* конструкционный принцип («оружие новой системы»); 
* и др. Изучением систем занимаются такие инженерные и научные дисциплины как общая теория систем, системный анализ, системология, кибернетика, системная инженерия, термодинамика, ТРИЗ, системная динамика и т. д.

